	const navigate = useNavigate()
	const [Email,setEmail]=useState("");
	const [Password,setPassword]=useState("");
	//const dispatch= useDispatch()
	//ADMIN
	//USER

	const login = () => {
		localStorage.setItem("user", JSON.stringify({role: "ADMIN"}))
		navigate("/dashboard")
		//console.table(Email,Password)
